CREATE OR REPLACE FUNCTION cr_upd_trig_func() RETURNS trigger AS '
BEGIN
	NEW.CREATE_DATE := NOW();
	NEW.UPDATE_DATE := NOW();
	RETURN NEW;
END
' LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION cr_l_upd_trig_func() RETURNS trigger AS '
BEGIN
	NEW.CREATE_DATE := NOW();
	NEW.LAST_UPDATE := NOW();
	RETURN NEW;
END
' LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION l_upd_trig_func() RETURNS trigger AS '
BEGIN
	NEW.LAST_UPDATE := NOW();
	RETURN NEW;
END
' LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION l_m_dt_trig_func() RETURNS trigger AS '
BEGIN
	NEW.LAST_MODIFIED_DATETIME := CURRENT_TIMESTAMP;
	RETURN NEW;
END
' LANGUAGE plpgsql;
