CREATE OR REPLACE FUNCTION SETUP_CONTENT_PROVIDERS (cpDomain IN VARCHAR, serverDomain IN VARCHAR) RETURNS setof record AS $$
DECLARE
  cnt numeric := 0;
BEGIN 
  SELECT count(1) INTO cnt FROM CONTENT_PROVIDER;
  IF (cnt = 0) THEN
								   VALUES('DEFAULT_CP', 'Default Content Provider', 'Y', cpDomain, NULL, 'DEFAULT_CP', '0');
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
  END IF;
END;
$$ LANGUAGE plpgsql;

